import React, { Component } from 'react';
import { connect } from 'react-redux';
import { getCoffee } from '../../actions';
import TheModal from '../Modal';
import CoffeeList from './CoffeeList';

import { LoadingOutlined } from '@ant-design/icons';

class CoffeeDelete extends Component {
	componentDidMount() {
		this.props.getCoffee(this.props.match.params.id);
		console.log(this.props);
	}

	render() {
		if (!this.props.coffeeToDelete) {
			return (
				<div>
					<LoadingOutlined />
				</div>
			);
		}
		return (
			<div>
				Delete Coffee
				<CoffeeList />
				{/* <TheModal coffeeToDelete={this.props.coffee} /> */}
			</div>
		);
	}
}

const mapStateToProps = (state, ownProps) => {
	return {
		coffeeToDelete: state.coffee[ownProps.match.params.id],
	};
};

export default connect(mapStateToProps, { getCoffee })(CoffeeDelete);
